import React from "react";
import "./navbar.css";

const Navbar = () => {
  return (
      <header>
      <nav className="navbar">
       {}
        <div className="navbar_left"><a href="/" className="navbar_logo">Sonnenhus</a></div>
        <div className="navbar_right">
          <ul className="navbar_navigation-items">
            <li><a href="/">Übersicht</a></li>
            <div className="dropdown">
                <li><p clasName="dropdown_header">Häuser</p></li>
                    <div class="dropdown-content">
                        <a href="#">Hus1</a>
                        <a href="#">Hus2</a>
                    </div>
            </div>
            <li><a href="/services">Informationen</a></li>
            <li><a href="/contact">Anreise</a></li>
          </ul>
        </div>
      </nav>
      </header>
  );
}

export default Navbar;
